import React from 'react';
import { Col } from 'reactstrap';
const Colxx = (props) => {
    return (
        <Col {...props} widths={['xxs', 'xs', 'sm', 'md', 'lg', 'xl', 'xxl']} />
    )
};
const Separator = (props) => (
    <div className={`separator ${props.className}`}></div>
);
export { Colxx, Separator }
